import { config } from '../config.js';
export default {

    /** Twitter Launches Spacex */
    getTwitterLaunches: () => {
        return fetch("https://api.twitter.com/1.1/statuses/user_timeline.json?screen_name=twitterapi&count=5")
            .then(res => res.json())
            .catch({ status: 500, message: 'Internal Server Error' });
    },

    /** Twitters Launches Spacex */
    getTwittersLaunches: () => {
        return fetch(config.baseConfig + "twitter-tweet")
            .then(res => res.json())
            .catch({ status: 500, message: 'Internal Server Error' });
    }

}
